import styled from 'styled-components';

export const Div = styled.div`
  background-color: cyan;
`

export const Button = styled.button`
  height: 64px;
  width: 64px;
  padding: 8px 16px;
  color: #2D2C2E;
  opacity: 0.5;
  transition: opacity 300ms;
  backdrop-filter: blur(5px);

  &:hover {opacity: 0.2}
`
